INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (8, 1, 2, 5118061, "青空の下で謁見", 20063115, 10118, 0, 2834, 7, "ペコリーヌとの出会い", 40, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", "フリーマーケット会場", 91002);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (8, 1, 2, 5118062, "未来の騎空団\nマスコット？", 20063115, 10118, 0, 2835, 7, "マホとの出会い", 40, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", "フリーマーケット会場", 91002);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (8, 1, 2, 5118063, "お嬢さまからの\n緊急依頼", 20063115, 10118, 0, 2837, 7, "アキノとの出会い", 40, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", "ランドソル市街地", 91002);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (8, 1, 2, 5118064, "黄金色の悩みごと", 20063115, 10118, 0, 4108402, 18, "ジュンとの出会い", 40, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", "フリーマーケット会場", 91002);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (8, 1, 2, 5118065, "白熱！　格闘大会！", 20063115, 10118, 0, 4107402, 18, "カオリとの出会い", 40, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", "フリーマーケット会場", 91002);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (8, 1, 2, 5118066, "祭り太鼓はオーエドの華", 20063115, 10118, 1, 9000227, 16, "ニノンとの出会い", 40, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", "オーエド町", 91002);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (8, 1, 3, 5118067, "人気者は遅れて\nやってくる", 20063115, 10118, 0, 2101181, 19, "スズナとの出会い", 40, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", "フリーマーケット会場", 91002);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (8, 1, 3, 5118068, "巫女・ミーツ・魔法少女", 20063115, 10118, 0, 4109402, 18, "ナナカとの出会い", 40, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", "ランドソル市街地", 91002);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (8, 1, 3, 5118069, "ネズ耳は二度なくなる", 20063115, 10118, 0, 4305402, 18, "キャル＆コッコロとの出会い", 40, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", "フリーマーケット会場", 91002);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (8, 1, 3, 5118070, "この出会いにカンパイ！", 20063115, 10118, 0, 4101402, 18, "ユカリとの出会い", 40, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", "ランドソル市街地", 91002);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (8, 1, 3, 5118071, "陰陽アンサンブル", 20063115, 10118, 0, 4106402, 18, "アオイとの出会い", 40, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", "ランドソル市街地", 91002);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (8, 1, 3, 5118072, "運試し十番勝負！", 20063115, 10118, 1, 2836, 7, "シノブとの出会い", 40, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", "フリーマーケット会場", 91002);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (0, 0, 1, 5118600, "彼女たちの新たな日常", 20063115, 10118, 0, 0, 0, "オープニング", 0, 0, 0, 0);
